impl ColorAtState<DontCare> for StatefulContract<DontCare, Red> {} /// Register that all StatefulContract<T>'s that implement OpenAtState
/// are Contracts
impl Contract for StatefulContract<T>
where Self : OpenAtState + ColorAtState { declare!{then, Self::do_something, Self::do_something_else}
} This technique showcases how Sapio could encode very sophisticated logic in program generation. It's also notable that following rustc v1.51, it is possible to use const's as generic type parameters which enables even more computation at the type level.

