} impl TryFrom<Concrete> for GenericA { type Error = &'static str; fn try_from(concrete:Concrete) -> Result<Self, Self::Error> { match concrete { Concrete::A(a) => GenericA(Box::new(a)), Concrete::B(b) => GenericA(Box::new(b)) } }
